@gamma_naught so I'm interested in using atlas as a vector database for something like this but with atlas and gpt4all: https://github.com/yoheinakajima/babyagi

This repo uses GPT3.5/4 and Pinecone. Pinecone is used to store and retrieve task results for context. The script creates a Pinecone index based on the table name specified in YOUR_TABLE_NAME variable. Pinecone is then used to store the results of the task in the index, along with the task name and any additional metadata.

Now the thing I'm wondering is, if I feed the LLM sensitive information like my codebase, documentation that includes ip addresses, etc so the bot can do things with it, will nomic look be able to see that sensitive information or sell it to third parties?

seems like lots of people want this
perhaps we should partner with them to build it out?
@Andriy , thoughts?

the tufte books are a great start
for latent space visualization in particular, id recommend:
 - https://idl.cs.washington.edu/files/2019-LatentSpaceCartography-EuroVis.pdf
 - https://arxiv.org/pdf/1710.11379.pdf

